import React from "react";
 
class SecondRight extends React.Component<any, any> {
  constructor(props: {} ) {
    super(props);
    this.state = {
        card : []
    };
    
  }
  componentDidMount() {
      fetch('.Stock.js').then(response => response.json())
      .then(data => {
        this.setState({
            card: data,
        });
      });
  }
  render() {
    return (
      <div>
 <div>
        {this.state.card.map((codes: { widgetName: boolean | React.ReactChild | React.ReactFragment | React.ReactPortal; }, index: React.Key) => {
            <h1 key={index}>{codes.widgetName}</h1>
        })}
    </div>
      </div>
   
    );
  }
}
 
export default SecondRight;
